import React from 'react';
import classes from './Adposts.module.css';
import Posts from './Posts';
import { Link } from "react-router-dom";

export default function Adposts() {
  return (
    <div className={classes.Supreme}>
      <p className={classes.para}>Fresh Recomendations</p>
      <div className={classes.Adposts}>
        <Link to="/ads/:1"><Posts /></Link>
        <Link to="/ads/:2"><Posts /></Link>
        <Link to="/ads/:3"><Posts /></Link>
        <Link to="/ads/:4"><Posts /></Link>
        <Link to="/ads/:5"><Posts /></Link>
        <Link to="/ads/:6"><Posts /></Link>
        <Link to="/ads/:7"><Posts /></Link>
        <Link to="/ads/:8"><Posts image="https://s3.amazonaws.com/www-inside-design/uploads/2020/10/aspect-ratios-blogpost-1x1-1.png"/></Link>
        <Link to="/ads/:9"><Posts /></Link>
        <Link to="/ads/:10"><Posts /></Link>
        <Link to="/ads/:11"><Posts /></Link>
        <Link to="/ads/:12"><Posts /></Link>
        <Link to="/ads/:13"><Posts /></Link>
        <Link to="/ads/:14"><Posts /></Link>
        <Link to="/ads/:15"><Posts /></Link>
        <Link to="/ads/:16"><Posts /></Link>
        <Link to="/ads/:17"><Posts /></Link>

      </div>
    </div>
  )
};
